// DeleteUniqueIndexCache 删除索引存在的缓存
func (s *SmsLogRepo) DeleteIndexCache(ctx context.Context, data ...*ai_boilerplate_model.SmsLog) error {
	KeyMap := make(map[string]struct{})
	keys := make([]string, 0)
	keys = append(keys, s.cache.Key(CacheSmsLogByConditionPrefix))
	for _, item := range data {
		if item != nil {
			KeyMap[s.cache.Key(CacheSmsLogByIDPrefix, item.ID)] = struct{}{}
			KeyMap[s.cache.Key(CacheSmsLogByMobilePrefix, item.Mobile)] = struct{}{}
		}
	}
	for item := range KeyMap {
		keys = append(keys, item)
	}
	err := s.cache.DelBatch(ctx, keys)
	if err != nil {
		return err
	}
	return nil
}
